import React from 'react';
import NavBar from '../../Components/NavBar';
import '../Header.css';
import HeaderChild from '../../Components/HeaderChild';

function HeaderParent(){
  return(
    <header className='container'>
      <NavBar />
      <HeaderChild/>
    </header>
  );
}

export default HeaderParent;
